import React from "react";

function SideIcons(props) {
    if (props.type == "text") {
        return (
            <div>
                <a href={props.href} className="SideIcons">
                    {props.name}
                </a>
                <br />
            </div>
        );
    }
    else if (props.type = "img") {
        return (
            <div>
                <img href={props.href} className="SideIcons">
                    {props.src}
                </img>
                <br />
            </div>
        );
    }
}

export default SideIcons;
